import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <h1>Welcome to My Schedule App</h1>

        <p>
          Start managing your schedule effectively.
        </p>
      </header>
        <main>
            <p>This is where the content will go.</p>
        </main>
    </div>
  );
}

export default App;
